　座高の低いお子様の顔や首筋にシートベルトが当たるのを防ぎます。<br><br>●ジュニアシートの補助具としてご使用ください。<br>●やわらかい素材を使用していますので、シートベルトの締め付けや、急ブレーキによるショックをやわらげます。<br>●左右どちらの車内席でもご使用できます。<br>●対象：身長100cm以上<br><br>■サイズ：約27×11×10cm<br>■備考：<br>素材・成分：生地/綿<br>中綿/ポリエステル<br>面ファスナー/ナイロン<br>【サンコー】<!--関連商品--><br><div class=reltitle> </div><div class=relink><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4513447293264.jpg?_ex=80x80 border=0><div class=rel_name>清水産業 ダニ退治シート　2枚セット </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/49733813009.jpg?_ex=80x80 border=0><div class=rel_name>サンコー すやすやパット2枚入 </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4973381301621.jpg?_ex=80x80 border=0><div class=rel_name>サンコー 水玉ベビーチェアシート </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4973381572908.jpg?_ex=80x80 border=0><div class=rel_name>サンコー ベビーカー用小物ポケット </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4973381573363.jpg?_ex=80x80 border=0><div class=rel_name>サンコー おむつ入れパック　2枚入　D-78　×2セット </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4973381573394.jpg?_ex=80x80 border=0><div class=rel_name>サンコー 車用傘ホルダー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/images/4973381573400.jpg?_ex=80x80 border=0><div class=rel_name>サンコー D-82　ベビーカー用汚れ防止カバー </div></div></div><!--/関連商品--><link href="http://www.rakuten.ne.jp/gold/orange-baby/css/style_ie.css" rel="stylesheet" type="text/css">



